import {RestraurantCard} from './RestraurantCard'

export const ResBody = ()=>{
    return(
      <div className="body">
        <div className="search">Search</div>
        <div className="res-container">/
          {ResData.map(ele =>(
            <RestraurantCard key={ele.info.id} resDetail = {ele}/>
          ))}
        </div>
      </div>
    )
  }
